pragma solidity ^0.8.17;

contract DelegateCall {
    uint public num;
    address public sender;
    uint public value;

    function setVars(address _test, uint _num) external payable {
        // This contract's storage is updated, TestDelegateCall's storage is not modified.
        (bool success, ) = _test.delegatecall(abi.encodeWithSignature("setVars(uint256)", _num));
        require(success, "tx failed");
    }

    function setNum(address _test, uint _num) external {
        // Write your code here
        (bool success,) = _test.delegatecall(abi.encodeWithSignature("setNum(uint256)", _num));
        require(success, "tx failed");
    }
}

